import React from "react";

const Footer = () => {
  return (
    <React.Fragment>
        <footer className="footer mt-auto py-3 bg-light">
            <div className="container">
                <span className="text-muted">University List App 2021.</span>
            </div>
        </footer>
    </React.Fragment>
  );
};

export default Footer;
